import booleanPointInPolygon from '@turf/boolean-point-in-polygon';
import fs from 'fs';

const rootPath = '../../preprocessing/geodata/maps/dist'
let DIV = JSON.parse(fs.readFileSync(`${rootPath}/div/div-c005-s010-vw-pr.geojson`, 'utf8'));
let DIS = JSON.parse(fs.readFileSync(`${rootPath}/dis/dis-c005-s010-vw-pr.geojson`, 'utf8'));
let UPA = JSON.parse(fs.readFileSync(`${rootPath}/upa/upa-c005-s010-vw-pr.geojson`, 'utf8'));
let UNI = JSON.parse(fs.readFileSync(`${rootPath}/uni/uni-c005-s010-vw-pr.geojson`, 'utf8'));
let MOU

try {
    MOU = JSON.parse(fs.readFileSync(`${rootPath}/mou/mou-c005-s010-vw-pr.geojson`, 'utf8'));
} catch (error) {
    console.error('error reading Mouza file')
    console.error('ensure that bash decompress-mou-geojson.sh has been run')
    process.exit(1)
}

function getGPSRegion(lat, lon) {
    if (!lat || !lon) {
        console.error('Missing required parameters: lat and lon');
        console.log(`,,,,`);
        return
    }

    try {
        const division = DIV.features.find((feature) => booleanPointInPolygon([lon, lat], feature.geometry));

        if (!division) {
            console.log(`,,,,`);
            return
        }

        const district = DIS.features
            .filter((feature) => feature.properties.div === division.properties.div)
            .find((feature) => booleanPointInPolygon([lon, lat], feature.geometry));

        if (!district) {
            console.error(`District not found for coordinates: ${lat},${lon}`);
            console.log(`${division.properties.div},,,,`);
            return
        }

        const upazila = UPA.features
            .filter((feature) => feature.properties.dis === district.properties.dis)
            .find((feature) => booleanPointInPolygon([lon, lat], feature.geometry));

        if (!upazila) {
            console.error(`Upazila not found for coordinates: ${lat},${lon}`);
            console.log(`${division.properties.div},${district.properties.dis},,,`);
            return
        }

        const union = UNI.features
            .filter((feature) => feature.properties.upa === upazila.properties.upa)
            .find((feature) => booleanPointInPolygon([lon, lat], feature.geometry));

        if (!union) {
            console.error(`Union not found for coordinates: ${lat},${lon}`);
            console.log(`${division.properties.div},${district.properties.dis},${upazila.properties.upa},,`);
            return
        }

        const mouza = MOU.features
            .filter((feature) => feature.properties.union === union.properties.union)
            .find((feature) => {
                try {
                    return booleanPointInPolygon([lon, lat], feature.geometry);
                } catch (error) {
                    console.error('Error processing feature:', feature);
                    console.error('in union:', union.properties);
                    console.error('Error message:', error.message);
                    return false;
                }
            }
        );

        if (!mouza) {
            console.error(`Mouza not found for coordinates: ${lat},${lon}`);
            console.log(`${division.properties.div},${district.properties.dis},${upazila.properties.upa},${union.properties.uni},`);
            return
        }

        console.log(`${division.properties.div},${district.properties.dis},${upazila.properties.upa},${union.properties.uni},${mouza.properties.mou}`);
    } catch (error) {
        console.error('Error processing the request:', error);
    }
}

